//Banker.js
import React from 'react';
import './banker.css';

function Banker({ receivedMessage }) {
  return (
    <div className="banker">
      <p className="announcement anc-message">
        {receivedMessage.type ? receivedMessage : "다른 플레이어의 차례를 기다리고 있습니다."}
      </p>
    </div>
  );
}

export default Banker;
